import React from 'react';
import './Tooltip.css';

const Tooltip = (props) => (
    <div class="tooltip  top in" style={{top: '108px', left: '900.5px', display: 'block'}}>
        <div class="tooltip-arrow" style={{left: '51.1628%'}}></div>
        <div class="tooltip-inner">{props.children}</div>
    </div>
);

export default Tooltip;
